import React from 'react';

import { connect } from 'react-redux';
import { setHeaderPopupFalse } from '../../redux/actions';

import './header-popup-window.css';

const HeaderPopupWindow = ({ setHeaderPopupFalse, headerPopup }) => {

    console.log(headerPopup);
    const handlePopupButtonClick = () => {
        setHeaderPopupFalse();
    }

    const display = headerPopup
        ? (
            <div className="upper-popup-window__wrapper">
                <p className="upper-popup-window__text">Быстрая доставка по Москве.</p>
                <span
                    className="upper-popup-window__close-button"
                    onClick={handlePopupButtonClick}></span>
            </div>
        )
        : <div className="header-popup-window__empty-block"></div>;

    return (
        <div className="header-popup-window">
            {
                display
            }

            {/* <div className="upper-popup-window">
                
            </div> */}
        </div >
    );
}

function mapStateToProps({ headerPopup }) {
    return { headerPopup }
}

export default connect(mapStateToProps, { setHeaderPopupFalse })(HeaderPopupWindow);
